            </div>
            <div>
              <input type="email" placeholder="Email" name="email" />
            </div>
            <div>
              <input type="password" placeholder="Password" name="password" />
            </div>
            <div>
              <button type="submit"> Sign Up </button>
            </div>
          </form>
        </div>
      </Layout>
      <style jsx>
        {`
          .container {
            max-width: 1200px;
            margin: 2rem auto;
          }
        `}
      </style>
    </>
  );
};

export default SignUp;
